def hexxor(a, b):    # xor two hex strings of the same length
    return "".join(["%x" % (int(x, 16) ^ int(y, 16)) for (x, y) in zip(a, b)])

elso = ""
masodik = ""
harmadik = "437279537953204c61622c2042756461"

for i in range(72):
    temp = hexxor(elso[i*32:i*32 + 32], masodik[i*32:i*32 + 32])
    print(hexxor(temp, harmadik))
    harmadik = hexxor(temp, harmadik)
